INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126931119, 'gsmlgu.geologicunit.ref-16777549126931119', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126931119', 'Vein quartz conglomerate, sand, silt, clay in fluvial braid plain, outwash fan and colluvial deposits; typically compositionally mature, with ubiquitous well-rounded pebbles and cobbles of reef quartz, lesser more angular vein quartz and bedrock clasts; moderately to well sorted, massive to crudely stratified, cross-bedded and channelled; richly auriferous in places;  variably ferruginised, silicified or kaolinised  ', 'typicalNorm', 'lithostratigraphic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/lithostratigraphic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126930435, 'gsmlgu.geologicunit.ref-16777549126930435', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126930435', 'Diamictite, gravel, sand, silt, clay, rubble: sorting variable, usually poor; generally poorly rounded; clasts locally sourced; includes channel deposits with better rounding and sorting', 'typicalNorm', 'geologic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/geologic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126930665, 'gsmlgu.geologicunit.ref-16777549126930665', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126930665', 'Olivine tholeiite, quartz tholeiite, basanite, basaltic icelandite, hawaiite, mugearite, minor scoria and ash, fluvial sediments: tholeiitic to alkaline; includes sheet flows and valley flows and intercalated gravel, sand, clay', 'typicalNorm', 'geologic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/geologic_unit', 'subgroup', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/subgroup');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126930407, 'gsmlgu.geologicunit.ref-16777549126930407', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126930407', 'Piles of waste material from mines.', 'typicalNorm', 'geologic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/geologic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126930428, 'gsmlgu.geologicunit.ref-16777549126930428', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126930428', 'Gravel, sand, silt: variably sorted and rounded; generally unconsolidated; includes deposits of low terraces; alluvial floodplain deposits ', 'typicalNorm', 'geologic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/geologic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126932864, 'gsmlgu.geologicunit.ref-16777549126932864', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126932864', 'Sandstone, mudstone, black shale and minor granule quartz conglomerate: mostly thick-bedded sandstone, coarse- to fine-grained, often graded, diffusely stratified to cross laminated, moderately to well sorted; sparsely fossiliferous with graptolites and phyllocarids; deep marine turbidites and hemipelagic sediments', 'typicalNorm', 'biostratigraphic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/biostratigraphic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126930906, 'gsmlgu.geologicunit.ref-16777549126930906', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126930906', 'Quartz sandstone: well sorted, fine to medium grained; well bedded; abundant lag horizons containing shelly fossils, pebble beds, rounded ironstone fragments; some heavy mineral concentrations; dissected or --obilised strand lines', 'typicalNorm', 'lithostratigraphic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/lithostratigraphic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126932018, 'gsmlgu.geologicunit.ref-16777549126932018', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126932018', 'Biotite granodiorite: medium grained, pale grey; equigranular to weakly porphyritic in plagioclase, quartz and K-feldspar; numerous enclaves; nonmagnetic; reduced; I-type', 'typicalNorm', 'lithodemic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/lithodemic_unit', 'lithodeme', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/lithodeme');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126930577, 'gsmlgu.geologicunit.ref-16777549126930577', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126930577', 'Silt, sand, gravel: generally poorly sorted and poorly rounded except within channels cut into colluvial material; dissected to variable degrees', 'typicalNorm', 'geologic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/geologic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126930850, 'gsmlgu.geologicunit.ref-16777549126930850', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126930850', 'Clay, sand, silt, pooly-sorted lenticular gravel. Dissected flood plain alluvium: terraces 1-10 metres above present river channels; well developed soil 2-3 m thick.', 'typicalNorm', 'lithostratigraphic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/lithostratigraphic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126931806, 'gsmlgu.geologicunit.ref-16777549126931806', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126931806', 'Biotite granodiorite: medium grained, equigranular granodiorite with numerous xenoliths of both sedimentary and igneous origin; nonmagnetic I-type', 'typicalNorm', 'lithodemic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/lithodemic_unit', 'lithodeme', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/lithodeme');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126932079, 'gsmlgu.geologicunit.ref-16777549126932079', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126932079', 'Biotite granite: pale grey, medium to coarse grained; commonly strongly porphyritic in K-feldspar; numerous metasedimentary enclaves and leucocratic dykes; nonmagnetic', 'typicalNorm', 'lithodemic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/lithodemic_unit', 'lithodeme', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/lithodeme');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126930540, 'gsmlgu.geologicunit.ref-16777549126930540', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126930540', 'Gravel, sand, silt, minor ferricrete; variably incised.', 'typicalNorm', 'geologic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/geologic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126931319, 'gsmlgu.geologicunit.ref-16777549126931319', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126931319', 'Tillite, diamictite, sandstone, mudstone, conglomerate: tillite and diamictite grey; massive to slump-folded; conglomerates range from pebble to boulder size; generally well-rounded; of highly varied lithology; mudstone dark grey to black; thinly bedded to laminated (varved); sedimentary dykes common; contains plant fossils and rare shallow-marine shelly fossils', 'typicalNorm', 'lithostratigraphic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/lithostratigraphic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126932922, 'gsmlgu.geologicunit.ref-16777549126932922', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126932922', 'Hornfels', 'typicalNorm', 'biostratigraphic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/biostratigraphic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126932931, 'gsmlgu.geologicunit.ref-16777549126932931', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126932931', 'Sandstone, mudstone, black shale and minor granule quartz conglomerate: mostly thick-bedded sandstone, coarse- to fine-grained, often graded, diffusely stratified to cross laminated, moderately to well sorted; sparsely fossiliferous with graptolites and phyllocarids; deep marine turbidites and hemipelagic sediments', 'typicalNorm', 'biostratigraphic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/biostratigraphic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
INSERT INTO cgireference.gsmlgu_geologicunit VALUES (16777549126932958, 'gsmlgu.geologicunit.ref-16777549126932958', 'http://resource.geosciml.org/feature/cgi/geologicunit/ref-16777549126932958', 'Sandstone, mudstone, black shale and minor granule quartz conglomerate: mostly thick-bedded sandstone, coarse- to fine-grained, often graded, diffusely stratified to cross laminated, moderately to well sorted; sparsely fossiliferous with graptolites and phyllocarids; deep marine turbidites and hemipelagic sediments', 'typicalNorm', 'biostratigraphic unit', 'http://resource.geosciml.org/classifier/cgi/geologicunitrank/biostratigraphic_unit', 'formation', 'http://resource.geosciml.org/classifier/cgi/stratigraphicrank/formation');
