-- =========================================
-- CREATE cgireference.gsml_mappedfeature ==
-- =========================================
CREATE TABLE cgireference.gsml_mappedfeature
  ( id numeric(32,0) NOT NULL, link_specification_id numeric(32,0), gml_id text, gml_identifier text, positionalaccuracy numeric(32,0),
    positionalaccuracy_uom_code text, positionalaccuracy_uom_href text, positionalaccuracy_uom_title text,
    resolutionscale_denominator integer, samplingframe_href text, samplingframe_title text, specification_type text,
    shape geometry NOT NULL, CONSTRAINT pk_gsml_mappedfeature PRIMARY KEY (id), CONSTRAINT enforce_dims_shape CHECK (ndims(shape) = 2),
    CONSTRAINT enforce_srid_shape CHECK (srid(shape) = 4283)) WITH (OIDS=TRUE);
CREATE INDEX spidx_gsml_mappedfeature ON cgireference.gsml_mappedfeature USING gist (shape);


-- =============================================
-- CREATE cgireference.gsml_observationmethod ==
-- =============================================
CREATE TABLE cgireference.gsml_observationmethod
  ( id numeric(32,0), link_mappedfeature_id numeric(32,0), swe_category_label text, swe_category_identifier text, 
    swe_category_codespace text, CONSTRAINT pk_gsml_observationmethod PRIMARY KEY (id) ) WITH (OIDS=TRUE);

